import React from 'react';
import { Link } from 'react-router-dom'
import {SwitchExample} from '../fancy_stuff/button_switch'


export const ChartEntry = (props) => {
  const { chartEntries } = props;
  if (chartEntries !== undefined) {
    return (
        <div>
          { chartEntries.myAP && chartEntries.myAP.map((entry, index) => {
            return (
                <Link to={'/projectAP/' + entry.AP_name} key={entry.AP_name}>
                    <p>{entry.AP_name}</p>
                    <SwitchExample></SwitchExample>
                </Link>
            )
          }) }
      </div>
    )
  } else {
    return (
      <div>
        <p> No Data to show </p>
      </div>
    )
  }
}
